using System.Collections.Generic;
using System.Linq;
using System.Xml.Linq;
using Microsoft.AspNetCore.Mvc;
using ServerApp.Models;

namespace ServerApp.Controllers
{
    [Route("api/[controller]")]
    public class ValuesController : Controller
    {
        private const string root = "Phones";
        private const string phoneObject = "Phone";
        private const string phoneId = "Id";
        private const string phoneName = "Name";
        private const string phonePicture = "Base64Image";
        private const string filePath = "phones.xml";

        public ValuesController()
        {
            XDocument phoneBaseDocument;
            if (!System.IO.File.Exists(filePath))
            {
                phoneBaseDocument = CreateBaseDocument();
            }
            else
            {
                phoneBaseDocument = XDocument.Load(filePath);

                phoneBaseDocument.Root.Name = root;
                phoneBaseDocument.Descendants(phoneObject)
                    .Where(x => x.Name != phoneObject ||x.Attribute(phoneId) == null)
                    .Remove();
            }
            phoneBaseDocument.Save(filePath);
        }

        [HttpGet]
        public IEnumerable<Phone> Get()
        {
            var phoneBase = XDocument.Load(filePath);

            return phoneBase.Descendants(phoneObject).Select(x => new Phone
            {
                Id = int.Parse(x.Attribute(phoneId)?.Value),
                Name = x.Element(phoneName)?.Value,
                Base64Image = x.Element(phonePicture)?.Value
            });
        }

        [HttpPost]
        public IActionResult Post([FromBody]Phone phone)
        {
            if (phone == null)
            {
                return BadRequest();
            }

            var phoneBase = XDocument.Load(filePath);
            phoneBase.Root?.Add(new XElement(phoneObject,
                     new XAttribute(phoneId, phone.Id),
                     new XElement(phoneName, phone.Name),
                     new XElement(phonePicture, phone.Base64Image)
                 ));

            phoneBase.Save(filePath);

            return Ok(phone);
        }

        [HttpPut]
        public IActionResult Put([FromBody]Phone phone)
        {
            if (phone == null)
            {
                return BadRequest();
            }


            var phoneBase = XDocument.Load(filePath);
            var phoneBaseUser = phoneBase.Descendants(phoneObject).FirstOrDefault(x => int.Parse(x.Attribute(phoneId)?.Value) == phone.Id);

            if (phoneBaseUser == null)
            {
                return NotFound();
            }

            phoneBaseUser.SetElementValue(phoneName, phone.Name);
            phoneBaseUser.SetElementValue(phonePicture, phone.Base64Image);

            phoneBase.Save(filePath);

            return Ok(phone);
        }

        [HttpDelete]
        public IActionResult Delete([FromBody]IEnumerable<int> id)
        {
            var phoneBase = XDocument.Load(filePath);
            var phoneBaseUser = phoneBase.Descendants(phoneObject).Where(x => id.Contains(int.Parse(x.Attribute(phoneId)?.Value)));
            phoneBaseUser.Remove();
            phoneBase.Save(filePath);

            return Ok();
        }

        public XDocument CreateBaseDocument()
        {
            var id = 0;
            return new XDocument(
                        new XElement(root,
                            new XElement(phoneObject,
                                new XAttribute(phoneId, id++),
                                new XElement(phoneName, "Iphone X"),
                                new XElement(phonePicture, "")
                            ),
                            new XElement(phoneObject,
                                new XAttribute(phoneId, id++),
                                new XElement(phoneName, "Galaxy S10"),
                                new XElement(phonePicture, "")
                            ),
                            new XElement(phoneObject,
                                new XAttribute(phoneId, id++),
                                new XElement(phoneName, "Sony Xperia Z3"),
                                new XElement(phonePicture, "")
                            )
                        )
                    );
        }
    }
}

